import React, {useState} from 'react';
import { Table } from 'reactstrap';

function AboutMe() {
	

	return(
		<div>
			<h1>Donghyun Kim</h1>
			<h3>Location: Calgary / AB / T2M 1Y7</h3>
			<h3>Mobile: 403-472-6707</h3>
			<h3>E-Mail: dean.kim0507@gmail.com</h3>
			<h3>LinkedIn: www.linkedin.com/in/donghyunkimdean</h3>

			<Table size="sm">
				<thead>
					<tr>
					<th><h3>Professional Profile</h3></th>
					</tr>
				</thead>
				<tbody>
					<tr>
					<th scope="row"><li>Good research skill including identifying when research is required.</li></th>
					</tr>
				</tbody>
			</Table>
		</div>
	);
}

export default AboutMe;
